                        this.click(w2ui.layout_main_tabs.tabs[w2ui.layout_main_tabs.tabs.length - 1].id);
                        return;
                    }
                    this.click(w2ui.layout_main_tabs.tabs[0].id);
                }
            }

        }
    ]
